import logo from './logo.svg';
import './App.css';
import Profile from './Pages/Profile'
import { BrowserRouter, NavLink, Route, Routes } from 'react-router-dom';
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/profile" element={<Profile/>}/>
      </Routes>

    </BrowserRouter>
  );
}

export default App;
